        private static void TestOAuthGetNoToken()
        {
            const string url = "https://api.tumblr.com/v2/preonboarding";

            var queryParams = new Dictionary<string, string>
            {
                ["force_oauth"] = "false"
            };

            using (var oauth = new OAuthConsumer(OAuthHttpMethod.GET, url, TumblrConstants.ConsumerKey,
                TumblrConstants.ConsumerSecret, new HMACSHA1(), queryParams))
            {
                var header = oauth.CreateOAuthAuthorizationHeader("-6136276619389499374", "1503712029");

                Debug.Assert(oauth.CalcualtedSignatureUrlEncodedBase64 == "f3D%2FU0DJyvn0W%2Fs2GjH9k4xxaL4%3D");
            }
        }

